e a good time learning together. &quot;Every accomplishment starts with the decision to try&quot;.'),(11630,4161,'_field_43','checked'),(11631,4161,'_field_42','Please test your computer with &lt;a href=&quot;http://www.speedtest.net/&quot;&gt;http://www.speedtest.net/&lt;/a&gt;. Your upload speed should be higher than 1MB.'),(11632,4161,'_field_7',''),(11633,4161,'_sub_id','4161'),(11640,3414,'68','0'),(11641,4171,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(11642,4171,'_form_id','6'),(11643,4171,'_seq_num','9'),(11644,4171,'_action','submit'),(11645,4171,'_field_14','Liu'),(11646,4171,'_field_15','Shengjie'),(11647,4171,'_field_9','deep.purple.sea.c@gmail.com'),(11648,4171,'_field_17','4803498419'),(11649,4171,'_field_16','US'),(11650,4171,'_field_18','Anthem'),(11651,4171,'_field_41','a:6:{i:0;s:6:\"儿童\";i:1;s:12:\"商务活动\";i:2;s:18:\"专业领域英语\";i:3;s:12:\"华裔家庭\";i:4;s:18:\"汉语等级考试\";i:5;s:12:\"普通汉语\";}'),(11652,4171,'_field_11','Hi dear all! This is Shengjie Liu. I am a Mandrin teacher at Arizona, USA. I am teaching elematary stufents Mandarin specials, and middle school explorotary course and high school course. That is a lot of work. However, I really love my job. In 2006, I stared my teaching job for the very first time. So far I have been teaching Chinese almost 10 years including part-time and full-time job. I graduated from Nanjing Normal University in 2013, majored in Teaching Chinese as A Second Language, receiving a Master’s Degree.In my opinion, a foreign Chinese teacher should have there basic qualities: speaking perfect Mandarin, having the professional knowledge about Chinese language and culture, Second language acquisition, Linguistics and Pedagogy, good communication competence, necessary foreign language skill. An excellent Chinese language teacher also need good patience, morals, enthusiasm of teaching and should encourage students rather than simple preach. Also there’s one more quality what people may ignore it. That’s the love to Chinese culture. I love Chinese culture, love Chinese food, love Chinese language and literature. I also love to share my love to Chinese by teaching Mandrin to everyone who wants to learn. By the way, I am a big fun of horror movies : )\r\nIf you want to learn Chinese, just do it. Remember learning Chinese is not easy, but refusing Chinese is even hard, because of the very attractive culture.'),(11653,4171,'_field_43','checked'),(11654,4171,'_field_42','Please test your computer with &lt;a href=&quot;http://www.speedtest.net/&quot;&gt;http://www.speedtest.net/&lt;/a&gt;. Your upload speed should be higher than 1MB.'),(11655,4171,'_field_7',''),(11656,4171,'_sub_id','4171'),(11664,4177,'_wp_attached_file','2016/03/image6732-4.png'),(11665,4177,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:304;s:6:\"height\";i:136;s:4:\"file\";s:23:\"2016/03/image6732-4.png\";s:5:\"sizes\";a:8:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:23:\"image6732-4-150x136.png\";s:5:\"width\";i:150;s:6:\"height\";i:136;s:9:\"mime-type\";s:9:\"image/png\";}s:14:\"shop_thumbnail\";a:4:{s:4:\"file\";s:23:\"image6732-4-180x136.png\";s:5:\"width\";i:180;s:6:\"height\";i:136;s:9:\"mime-type\";s:9:\"image/png\";}s:12:\"shop_catalog\";a:4:{s:4:\"file\";s:23:\"image6732-4-300x136.png\";s:5:\"width\";i:300;s:6:\"height\";i:136;s:9:\"mime-type\";s:9:\"image/png\";}s:15:\"guest-author-32\";a:4:{s:4:\"file\";s:21:\"image6732-4-32x32.png\";s:5:\"width\";i:32;s:6:\"height\";i:32;s:9:\"mime-type\";s:9:\"image/png\";}s:15:\"guest-author-64\";a:4:{s:4:\"file\";s:21:\"image6732-4-64x64.png\";s:5:\"width\";i:64;s:6:\"height\";i:64;s:9:\"mime-type\";s:9:\"image/png\";}s:15:\"guest-author-96\";a:4:{s:4:\"file\";s:21:\"image6732-4-96x96.png\";s:5:\"width\";i:96;s:6:\"height\";i:96;s:9:\"mime-type\";s:9:\"image/png\";}s:16:\"guest-author-128\";a:4:{s:4:\"file\";s:23:\"image6732-4-128x128.png\";s:5:\"width\";i:128;s:6:\"height\";i:128;s:9:\"mime-type\";s:9:\"image/png\";}s:4:\"mini\";a:4:{s:4:\"file\";s:22:\"image6732-4-120x54