 my site.\r\n\r\nPlease see: wedemic.com\r\n\r\nThe financial part is very straight forward, you can list your courses on Wedemic. I believe you will find it easy to use since you are also using the WPLMS set up. You can offer free courses and paid courses. For paid courses, you will receive back 80% (less paypal transfer charges) and we only retain 20% to help us continue maintain and promote the site.\r\n\r\nPlease let me know if you are keen and i will be glad to assist further.\r\n\r\nLooking forward to your reply.\r\n\r\nCheers!\r\n\r\nUlysses\r\n(Singapore)'),(12399,4360,'_field_5',''),(12400,4360,'_sub_id','4360'),(12401,4361,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12402,4361,'_edit_lock','1462465031:370'),(12403,4361,'_edit_last','1'),(12404,4362,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12405,4362,'_edit_lock','1458840020:1'),(12406,4362,'_edit_last','1'),(12407,4363,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12408,4364,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12409,4365,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12410,4366,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12411,4367,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12412,4368,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12413,4369,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12414,4370,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12415,4371,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12416,4372,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12417,4373,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12418,4374,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12419,4375,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12420,4376,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12421,4377,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12422,4378,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12